script: |
  super -f text -I q6101.spq | sort > q6101.out

inputs:
  - name: q6101.spq
    data: |
      SELECT - col1 + + col2 AS col0 FROM tab1 (FORMAT parquet) WHERE + col0 * - - col2 NOT BETWEEN 75 AND col1 / col1;
  - name: tab1

outputs:
  - name: q6101.out
    data: |
      21
      54
      82
